import React, { useState, useEffect } from "react";
import axios from "axios";
import ClothesList from "../components/ClothesList";

const ShirtPage = () => {
  const [shirts, setShirts] = useState([]);

  const fetchShirts = async () => {
    try {
      const response = await axios.get("http://localhost:3001/clothes");
      // Filter only shirts
      const filteredShirts = response.data.filter(
        (item) => item.clothingtype.toLowerCase() === "shirt"
      );
      setShirts(filteredShirts);
    } catch (error) {
      console.error("Error fetching shirts:", error);
    }
  };

  useEffect(() => {
    fetchShirts();
  }, []);

  return (
    <div className="shirts-page p-4">
      <h1 className="text-2xl font-bold mb-4">Shirts</h1>
      <ClothesList clothes={shirts} />
    </div>
  );
};

export default ShirtPage;
